check, DB_data, DB_express, DB_express_1, DB_num) values('N', '거무스레한 살빛에 광대뼈가 튀어나왔습니다.<BR>&nbsp;<BR>긴 타원형의 얼굴에 눈빛은 부드럽습니다. 표준형 체<BR>격입니다. ', '亥', '자미과', '128');insert into J022(DB_check, DB_data, DB_express, DB_express_1, DB_num) values('N', '얼굴은 길고 타원형이며 살결은 검은 편입니다. <BR><BR>광대뼈가 튀어 나왔고 몸집은 보통입니다. 간혹 깡마<BR>른 사람도 있습니다. ', '丑', '자미과', '131');insert into J022(DB_check, DB_data, DB_express, DB_express_1, DB_num) values('N', '둥그스름하면서 네모에 가깝습니다. 귓볼이 특이한 사<BR>람도 있고 눈꼬리가 아래로 쳐져 있으며 눈빛이 곱고 <BR>늘 웃는 모습입니다. <BR><BR>눈꼬리에 주름이 있어 웃으면 실눈이 됩니다. 무게를 <BR>느낄 수 있는 체격에 비해 목소리는 명쾌하고 가볍습<BR>니다. ', '申', '천기과', '138');insert into J022(DB_check, DB_data, DB_express, DB_express_1, DB_num) values('N', '눈썹이 진하고 눈이 가늘고 길며 잎술 옆으로 법령이 <BR>확연하며 침착하고 묵직한 모습입니다. 체구는 뼈대나<BR>근육이 잘 발달되어 있는 거구인 경우가 많습니다. <BR><BR>어릴때부터 체격이 당당하여 함부로 말 붙이기가 어려<BR>운 모습입니다. ', '未', '천기과', '144');insert into J022(DB_check, DB_data, DB_express, DB_express_1, DB_num) values('N', '눈매가 용맹스럽고 눈꼬리가 위로 치켜 올라 갔으며 <BR>그런 인상 때문에 위풍당당한 모습으로 보입니다. 튼<BR>튼한 골격에 선이 굵은 체형입니다.<BR>&nbsp;<BR>&nbsp;남녀 공히 목소리가 투박하고 굵으며 말씨나 행동이 <BR>거칩니다. ', '午', '천량과', '146');insert into J022(DB_check, DB_data, DB_express, DB_express_1, DB_num) values('N', '아래턱뼈가 발달하였고 둥그스름한 얼굴입니다. 눈빛<BR>이 강렬하며 살결이 윤기가 있습니다. <BR><BR>목소리는 쉰듯하며 말이 빠릅니다. 중간키 정도에 단<BR>단한 근육질이 있는 체격입니다. ', '酉', '천량과', '148');insert into J022(DB_check, DB_data, DB_express, DB_express_1, DB_num) values('N', '눈썹부위가 튀어나오고 관골이 튀어나와 있습니다. 눈<BR>꼬리나 눈썹이 끝이 치켜올라가 무섭게 느껴지는 인상<BR>입니다. <BR><BR>보통 범상이라 보며 위압감이 넘쳐 평소에도 근접하기<BR>어려운 면모입니다.&nbsp;', '申', '천량과', '150');insert into J022(DB_check, DB_data, DB_express, DB_express_1, DB_num) values('N', '고상해 보이면서 위세가 넘치는 표정으로 보통키에 약<BR>간은 살이 찐듯한 풍채입니다.<BR>&nbsp;<BR>얼굴은 조금 모가난듯 하면서도 대체로 둥그스름합니<BR>다. 눈초리가 사납게 느껴저 처음 대하는 사람에게 위<BR>압감을 줍니다. ', '巳', '천량과', '151');insert into J022(DB_check, DB_data, DB_express, DB_express_1, DB_num) values('N', '얼굴의 전체적인 간격이나 크기가 균형을 잃었고 허<BR>리가 평소에 약간 구부정한 점이 특징입니다. 평범하<BR>고 담백해 보이면 수수하고 털털한 인상입니다.&nbsp;', '子', '태음과', '157');insert into 